import React, { useContext } from "react";
import { AppContext } from "../initialState";
import { IonContent, IonFooter, IonGrid, IonHeader, IonPage, IonRow, IonToolbar, IonCol, IonInput, IonButton } from "@ionic/react";

const ChatPage = () => {
    let { state, dispatch } = useContext(AppContext);

    return (
        <IonPage>
            <IonHeader>{state.chattingWith}</IonHeader>
            <IonContent>
                <p>This is the chatpage bro..</p>
            </IonContent>
            <IonFooter>
                <IonToolbar>
                    <IonGrid>
                        <IonRow>
                            <IonCol slot="start" >

                                <IonInput ></IonInput>
                            </IonCol>
                            <IonCol size="2">

                                <IonButton slot="end">Send</IonButton>
                            </IonCol>
                        </IonRow>
                    </IonGrid>
                </IonToolbar>

            </IonFooter>
        </IonPage>
    );
}

export default ChatPage;
